import React from 'react';
import RayaLogo from 'assets/media/raya-logo.svg';

const NavBar = () => (
  <div className="raya-navbar box has-background-dark has-text-light">
    <img className="raya-logo p-1" src={RayaLogo} alt="raya-logo" />
    <div>
      <div>Applicants</div>
      <div>Stats</div>
      <div>Members</div>
      <button type="button" className="buttonis-primary is-light">
        <i className="fas fa-power-off" />
        Logout
      </button>
    </div>
  </div>
);

export default NavBar;
